The United 747-400 is also no longer in service. In fact it was last US carrier to have a 747 still in service.

Another note is, a week from today my dad will be officially retired from flying commercial flights for the airlines. 

I’m super excited and sad at the same time to be on the last flights he will ever work. He accomplished his dreams to being a United Airlines captain and flying some of the best planes imaginable. I’m honestly so proud of him and all of his accomplishments.

Because of his job, I have been fortunate to have flown all over the world and see things that not many people get to see. Cheers to a Happy Retirement!
